buileach air an fheadhainn a ghlac ris fuasgladh no réiteachadh a chur air . Feumaidh a h - uile fear a bhuin ris roimh so aideachadh gu saor soilleir nach eil an gnothach idir soirbh a dhèanamh am mach ; agus gu ’ m bheil sinn fathast a dhìth air modh no dòigh air a bhi buntainn ris a fhreagras gu ceart cuimir air a h - uile rud air am bheil fios cinnteach againn mu ’ n chùis . Is iomadh fear a thug ionnsaigh roimh so air éirigh suas Ghille - Chrìosd a shoilleireachadh duinn , agus mineachadh earbsach a cho - chur ri chéile air mar a dh ’ éirich an tagradh a sheas na Dorsairean , còmhla ri solus a thilgeil air nàdur an tagraidh a thug iad air lom ; ach ged a rachadh againn air cuid de na baraileachan a leig iad so seachad a cho - dhaingneachadh , gidheadh is éiginn duinn aideachadh nach eil anns a ’ chuid is mò dhiubh ach beachdan gun bhrìgh , gun stàth , gun bhonn . Mar thuaireaman tùrail gealltanach , chan eil iad , gun teagamh , gu buileach gun fhiù . Do bheothalachd meanmnachd , amhuil mar do fharsaingeachd eolais , na feadhnach a thug iad an céill tha iad a ’ toirt na h - urram is mò ; ach mar mheadhonan earbsach gu fuasgladh a chur , no ùr sholus a thilgeil , is beag am feum a ni iad duinn . An cunntas is earbsaiche a th ’ againn air Morgunn , Gille - Crìosd , Donnachadh , is Uilleam , gheibhear e sin air a chur sios anns an Scots Peerage ,
aig Sir J . Balfour Paul ;
ach mar a leig mi thuigsinn do ’ n leughadair mar tha , chan fhaodar sealltuinn air a ’ chunntas a gheibhear an sin ach mar chruaidh - spairn a rinneadh leis an fheadhainn leis am maith cuid de na ceistean cruaidh tha dlùth - fhillte suas le eachdraidh na moraireachd a chur air shùilean duinn , agus iad sin a mhineachadh

